import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App.jsx";
import dotenv from "dotenv";
import connectDB from "../database/connect";

connectDB();
dotenv.config();

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
